  const [background, setBackground] = useState(null)

  useEffect(() => {
    if (background) {
      document.body.style.background = background
    }
  }, [background])

  return (
    <div className="app">

      <Navbar
        setBackground={setBackground}
      />

      <div className="content">
              <LeftContentBar

              />

              <div className="content__right">

              </div>
      </div>

    </div>
  );
}

export default App;
